import './App.css';
import HomePage from './HomePage';
import { Link, Route, Routes } from 'react-router'
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <>
      <nav className='nav'>
        <Link to='/'>Home</Link>
      </nav>
      <Routes>
        <Route path='/' element={<HomePage />} />
      </Routes>
    </>
  );
}

export default App;
